    [],nt"revision_timestamp": "2013-03-15T10:27:11.750624",nt"name": "true-color-orthophotography-for-fossil-butte-national-monument-vegetation-mapping-project",nt"isopen":
    false,nt"url": null,nt"notes": "This photo mosaic of Fossil Butte National
    Monument was created from scanned 9x9s flown in 2004 in conjunction with the Vegetation
    Mapping Program. The photography was acquired at a nominal elevation of 6,000 ft
    (1,829 m) above ground level in a Cessna T210N aircraft. A Wild RC10 camera with
    15.3 cm (6 in) lens was used with Kodak Aerocolor negative film. The target scale
    for this photography was 1:12,000 (1 in = 1,000 ft). The mission was designed with
    approximately 30% sidelap between flight lines and 60% overlap between photos. The
    project encompassed 22 linear km (13.7 miles) divided among 6 flight lines and 57
    individual photos",nt"license_title": null,nt"extras": [{ntt"key":
